<section id="monte-carlo-simulation-and-3-d-histogram" class="level2">
<h2 class="anchored" data-anchor-id="monte-carlo-simulation-and-3-d-histogram">Monte Carlo Simulation and 3-D Histogram</h2>
<p>This is a plot of the distribution of the margin of error when both sample size and sample standard deviation changes. Both values are simulated using uniform distribution. We use 10,000 Monte Carlo simulations.</p>

    function throttle(fn, ms) {
    let throttle = false;
    let timer;
      return (...args) => {
        if(!throttle) { // first call gets through
            fn.apply(this, args);
            throttle = true;
        } else { // all the others get throttled
            if(timer) clearTimeout(timer); // cancel #2

              fn.apply(this, args);
